import Worker_Message from './worker_message.component';

class Dashboard_Worker extends Component {

	render() {

		// console.log(this);

		return(

			<div className = 'container'>

				<div className = 'container'>

					<h3>

						Area de Operaciones de Calderas en empresa Future Inc.

